import React from 'react';
import ReactDOM from 'react-dom';
import {Container} from '@material-ui/core';
import TitleBar from './components/TitleBar'
import Summary from './components/Summary'
import TransactionsList from './components/TransactionsList'

import './App.css';

function App() {
  const getPlaidAccounts = () => {

    // const storedAccounts = window.localStorage.getItem("plaid_account");
    // if (storedAccounts) {return storedAccounts.json()}
    // else {return false}
    return [
      {
        name: "Natwest",
        balance: 199.44,
        image_url: ""
      }
    ]

  }

  const [accounts, setAccounts] = React.useState(getPlaidAccounts);

  return (<Container maxWidth="sm">
    <TitleBar accounts={accounts} addedAccountChecker={() => setAccounts(getPlaidAccounts())}/>
    <Summary accounts={accounts}/>
  </Container>);
}

export default App;
